import React, { useState,useEffect } from 'react';
import ReactDOM from 'react-dom';
import { Link,useHistory } from 'react-router-dom';

function Navbar(props) { 

  let history = useHistory();

  const [user, setUser] = useState({});
    useEffect(() => {

        setInterval(() => {
            const userString = localStorage.getItem("myData");
            const user = JSON.parse(userString);
            setUser(user);
            }, [])
    }, 5000);


    const logout = () => {
         localStorage.removeItem("myData");
         history.push('/Login')   
    }

    let search = (event)=>{

      event.preventDefault()
     if(event.target.value!='' || event.target.value!=undefined) {
        var url = "/search?q="+event.target.value
     }
  }


  return (
    <div>
      <div className="container" style={{marginTop:'50px',marginBottom:'20px'}}>
      <div className="row">
      <div className="col-sm-4">
      <Link to="/" style={{textDecoration:'none',color:'black'}}>  <h2>Cake Shop</h2> </Link>
       </div> 
       <div className="col-sm-4">
       <form className="d-flex">
        <input onChange={getSearchText} className="form-control form-control-lg" type="search" placeholder="Search" aria-label=".form-control-lg example" />
        <button onClick={search} className="btn btn-outline-success" type="submit">Search</button>
      </form>
       </div> 
       <div className="col-sm-4">

        <h5 style={{float:'right'}}><i class="fa fa-user" aria-hidden="true" style={{marginRight:'10px'}}></i>
        {!user &&
 <Link to="/Login" style={{textDecoration:'none',color:'black'}}> Login  </Link>  }

{ user &&
 <span style={{textDecoration:'none',color:'black',cursor:'pointer'}} onClick={logout}> Logout  </span>  }

 | 

 <Link to="/Signup" style={{textDecoration:'none',color:'black'}}> Register  </Link>  </h5> 

       </div> 
      </div>
      </div>
      <hr />
  <nav className="navbar navbar-expand-lg navbar-light bg-light">
  <div className="container">
    <a className="navbar-brand" href="#">Precription</a>
    <a className="navbar-brand" href="#"><i class="fa fa-heart" aria-hidden="true" style={{color:'black'}}></i>Blog</a>
    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarSupportedContent" style={{marginLeft:'50px'}}>
      <ul className="navbar-nav me-auto mb-2 mb-lg-0" style={{fontWeight:'bold'}}> 
        <li className="nav-item">
          <a className="nav-link" aria-current="page" href="#"><i class="fa fa-angle-double-right" aria-hidden="true" style={{marginRight:'5px'}}></i>Motprot</a>
        </li>
        <li className="nav-item" style={{marginLeft:'20px'}}>
          <a className="nav-link" href="#"><i class="fa fa-angle-double-right" aria-hidden="true" style={{marginRight:'5px'}}></i>Coffee For Many</a>
        </li>
        <li className="nav-item" style={{marginLeft:'20px'}}>
          <a className="nav-link" href="#"><i class="fa fa-angle-double-right" aria-hidden="true" style={{marginRight:'5px'}}></i>Easy To Make </a>
        </li>
        <li className="nav-item" style={{marginLeft:'20px'}}> 
          <a className="nav-link" href="#"><i class="fa fa-angle-double-right" aria-hidden="true" style={{marginRight:'5px'}}></i>Breakfast </a>
        </li>
      </ul>
      <button class="btn btn-success btn-lg"> CREATE <i class="fa fa-plus" aria-hidden="true" style={{marginRight:'5px'}}></i></button>
    </div>
  </div>
</nav>
    </div>
  );
}

export default Navbar;
